import React from 'react';
import './App.css';

const App: React.FC = () => {
    return (
        <div className={"app-wrapper"}>
            <header>
                <img src={"https://cdn.pixabay.com/photo/2015/04/23/22/00/tree-736885_1280.jpg"}/>
            </header>
            <nav>
                <div>
                    Profile
                </div>
                <div>
                    Messages
                </div>
            </nav>
            <div>
                Main Content
            </div>
        </div>
    );
}


export default App;
